import React from 'react';
import { Link } from 'react-router-dom';

function ClientSidebar() {
    return (
        <aside className="sidenav">
            <img src="dist/img/PrakriaLogo_Final.png" alt="Prakria Direct Logo" className='Logo' />
            <button className='create-btn'>Create a project</button>
            <nav className='nav-menu'>
                <ul>
                    <li><Link to={"/client/projects"}></Link>Projects</li>
                    <li>Brands</li>
                    <li>Files</li>
                    <li>Add a Resource</li>
                    <li>Account</li>
                    <li>Logout</li>
                </ul>
            </nav>
        </aside>
    );
}

export default ClientSidebar;
